import React from "react";
import Slider from "react-slick";
import styles from "./home.module.css";
import img1 from "../../assets/fp1.jpeg";
import img2 from "../../assets/fp2.jpeg";
import img3 from "../../assets/fp3.jpeg";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faChevronLeft,
  faChevronRight,
} from "@fortawesome/free-solid-svg-icons";

export default function Home() {
  const settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    className: styles.slider,
    arrows: true,
    prevArrow: <FontAwesomeIcon icon={faChevronLeft} />,
    nextArrow: <FontAwesomeIcon icon={faChevronRight} />,
  };

  return (
    <div className={styles.container}>
      <Slider {...settings}>
        <div className={styles.slide}>
          <div className={styles.card}>
            <img src={img1} alt="img1" />
            <div className={styles.text}>
              <h3>1</h3>
              <p>Description of image 1 goes here.</p>
            </div>
          </div>
        </div>
        <div className={styles.slide}>
          <div className={styles.card}>
            <img src={img2} alt="img2" />
            <div className={styles.text}>
              <h3>2</h3>
              <p>Description of image 2 goes here.</p>
            </div>
          </div>
        </div>
        {/* <div className={styles.slide}>
          <div className={styles.card}>
            <img src={img3} alt="img3" />
            <div className={styles.text}>
              <h3>3</h3>
              <p>Description of image 3 goes here.</p>
            </div>
          </div>
        </div> */}
      </Slider>
      <button className={styles.button} href="/events">
        See More Events
      </button>
    </div>
  );
}
